import React from 'react';
import Header from './Components/Header';
import List from './Components/List';
import Info from './Components/Info';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
        <h1>Welcome to my app</h1>
        <Header />

        <Switch>
          {/* <Route path="/about">
            <About />
          </Route> */}
          <Route path="/List">
            <List />
          </Route>
          <Route path="/">
            <Info />
          </Route>
        </Switch>

        {/* Uncomment the lines below if you want to render List and Info components outside of the Switch */}
        {/* <List/>
        <Info/> */}
      </div>
    </Router>
  );
}

export default App;
